      "& span, svg": {
        verticalAlign: "middle",
      },
      "& a": {
        color: "#29b6f6",
      },
    },
    "& hr": {
      border: "none",
      margin: "0 0 10px 0",
    },
    "& svg.button": {
      "&:hover": {
        cursor: "pointer",
      },
    },
  },
});

